Recommended for use with iOS 9.0 and above
Vss Mobile is remote monitoring client software with below functions.

1, the software allows the user to carry over WIFI, 2G, 3G, 4G video viewing;
2, the software supports P2P penetrate the network function, two-dimensional code scanning capabilities;
3, the software supports IP and domain direct connection function;
4, the software supports single or four player, multi-channel switching, screenshots, videos, open sound, voice talk, stream switch functions;
5, the software supports ptz's up and down, left and right, focus, zoom and iris control, preset, cruise, pattern and other functions;
6, the software supports remote playback function;
7, the software supports real-time alarm function;
8, the software supports Remote Network remote control function;
9, the software supports local image and local video viewing;
10, the software supports muti-view preview function;
11, the software support favorites and play history functions;
12, the software support update device’s local setting function;
